import React, { useState } from 'react';
import './Projects.css';

const Projects = () => {
  const [activeFilter, setActiveFilter] = useState('all');

  const projects = [
    {
      id: 1,
      title: 'SubjECTive-QA: NeurIPS Dataset',
      description: 'Measuring Subjectivity in Earnings Call Transcripts QA through Six-Dimensional Feature Analysis. Published research analyzing financial document subjectivity using advanced NLP techniques.',
      image: 'https://via.placeholder.com/400x250/667eea/ffffff?text=NLP+Research',
      technologies: ['Python', 'NLP', 'Machine Learning', 'Financial Analysis'],
      category: 'research',
      demo: '#',
      github: '#'
    },
    {
      id: 2,
      title: 'Language Modeling for Finance',
      description: 'Scraped 400 papers from ACL Anthology using Selenium, analyzed monetary policy communications from 27 central banks. Developed 133-page annotation guide and evaluated 16 LMs.',
      image: 'https://via.placeholder.com/400x250/764ba2/ffffff?text=Financial+ML',
      technologies: ['Python', 'Selenium', 'LLMs', 'Financial Data'],
      category: 'research',
      demo: '#',
      github: '#'
    },
    {
      id: 3,
      title: 'Quantitative Trading Engine',
      description: 'Created a backtrading engine using Monte Carlo simulations and bootstrapping. Developed framework for financial data analysis using backtrader to compute 55 risk metrics per strategy.',
      image: 'https://via.placeholder.com/400x250/f093fb/ffffff?text=Trading+Engine',
      technologies: ['Python', 'Monte Carlo', 'Backtrader', 'Risk Analysis'],
      category: 'finance',
      demo: '#',
      github: '#'
    },
    {
      id: 4,
      title: 'FIdent: Differential Equations Research',
      description: 'Exploring novel applications for identifying differential equations (WeakIDENT) in noisy datasets and financial markets. Advised by Dr. Sung Ha Kang at Georgia Tech.',
      image: 'https://via.placeholder.com/400x250/87ceeb/ffffff?text=Differential+Equations',
      technologies: ['MATLAB', 'Mathematical Modeling', 'Python', 'Research'],
      category: 'research',
      demo: '#',
      github: '#'
    },
    {
      id: 5,
      title: 'Mutual Fund Attribution Model',
      description: 'Collaborated with quantitative traders to develop contribution-attribution model for mutual funds. Enhanced relative value analysis, improving analytical systems by 22%.',
      image: 'https://via.placeholder.com/400x250/98fb98/ffffff?text=Fund+Analysis',
      technologies: ['Python', 'Statistical Analysis', 'Quantitative Models'],
      category: 'finance',
      demo: '#',
      github: '#'
    },
    {
      id: 6,
      title: 'ML Trading Strategy',
      description: 'Generated novel trading strategy and ML-based tool achieving 13.5% alpha with a team of 15 researchers. Developed five-layer mutual fund analyzer using advanced statistical models.',
      image: 'https://via.placeholder.com/400x250/ffd700/ffffff?text=ML+Strategy',
      technologies: ['Machine Learning', 'Python', 'Statistical Models', 'Alpha Generation'],
      category: 'finance',
      demo: '#',
      github: '#'
    }
  ];

  const filters = [
    { key: 'all', label: 'All Projects' },
    { key: 'research', label: 'Research' },
    { key: 'finance', label: 'Finance' },
    { key: 'ml', label: 'Machine Learning' }
  ];

  const filteredProjects = activeFilter === 'all' 
    ? projects 
    : projects.filter(project => project.category === activeFilter);

  return (
    <section id="projects" className="projects">
      <div className="container">
        <div className="section-header">
          <h2 className="section-title">Research & Projects</h2>
          <p className="section-subtitle">Exploring the intersection of mathematics, ML, and finance</p>
        </div>

        <div className="filter-tabs">
          {filters.map(filter => (
            <button
              key={filter.key}
              className={`filter-tab ${activeFilter === filter.key ? 'active' : ''}`}
              onClick={() => setActiveFilter(filter.key)}
            >
              {filter.label}
            </button>
          ))}
        </div>

        <div className="projects-grid">
          {filteredProjects.map(project => (
            <div key={project.id} className="project-card">
              <div className="project-image">
                <img src={project.image} alt={project.title} />
                <div className="project-overlay">
                  <div className="project-links">
                    <a href={project.demo} className="project-link demo">
                      <span>Learn More</span>
                    </a>
                    <a href={project.github} className="project-link github">
                      <span>Details</span>
                    </a>
                  </div>
                </div>
              </div>
              <div className="project-content">
                <h3 className="project-title">{project.title}</h3>
                <p className="project-description">{project.description}</p>
                <div className="project-technologies">
                  {project.technologies.map((tech, index) => (
                    <span key={index} className="tech-tag">{tech}</span>
                  ))}
                </div>
              </div>
            </div>
          ))}
        </div>
      </div>
    </section>
  );
};

export default Projects;
